import React from "react";
import { Link } from "react-router-dom";
const Head = () =>{
    return(
        <div class="jumbotron jumbotron-fluid btn btn-outline-light text-dark">
            <header className='navbar'>
            
            <div class=''>
                <Link className="btn btn-primary" to="/home">Employer Home</Link>
                <Link className="btn btn-dark" to="/add/deliveryMan">Create DeliveryMan</Link>
                <Link className="btn btn-dark" to="/deliveryMan/list">DliveryMan List</Link>
                <Link className="btn btn-dark" to="/add/category">Add Category</Link>
                <Link className="btn btn-dark" to="/category/list">Category List</Link>
                <Link className="btn btn-dark" to="/add/product">Add Product</Link>
                <Link className="btn btn-dark" to="/product/list">Product List</Link>

                {/* <Link className="button  button2" to="#">Manage Order</Link>
                <Link className="button  button2" to="#">Order History</Link> */}
                <Link className="btn btn-dark" to="/customer/list">Manage Customer</Link>

                <Link className="btn btn-danger" to="/logout">Logout</Link>
            </div>
            </header>
        </div>
    )
}
export default Head;
